$(document).ready(function(){var carousel=$("#carousel").waterwheelCarousel({flankingItems:3,movingToCenter:function(e){$("#callback-output").prepend("movingToCenter: "+e.attr("id")+"<br/>")},movedToCenter:function(e){$("#callback-output").prepend("movedToCenter: "+e.attr("id")+"<br/>")},movingFromCenter:function(e){$("#callback-output").prepend("movingFromCenter: "+e.attr("id")+"<br/>")},movedFromCenter:function(e){$("#callback-output").prepend("movedFromCenter: "+e.attr("id")+"<br/>")},clickedCenter:function(e){$("#callback-output").prepend("clickedCenter: "+e.attr("id")+"<br/>")}});$("#prev").bind("click",function(){return carousel.prev(),!1}),$("#next").bind("click",function(){return carousel.next(),!1}),$("#reload").bind("click",function(){return newOptions=eval("("+$("#newoptions").val()+")"),carousel.reload(newOptions),!1})});